?><div align="justify"><span style="font-size: medium;"><span style="font-family: &quot;Times New Roman&quot;;">Эта американская компания по производству часов была основана в конце 20-го века, а конкретнее в 1998 году. В то время, основатель компании Майкл Кобальд был обычным студентом питтсбургского университета. Свой выбор профессии он объясняет тем, что увлечение часами пришло к нему в 12 лет, и уже с того возраста он великолепно в них разбирался. Основу собственной компании Майкл заложил еще в 19-летнем возрасте. Но в то время это было всего лишь увлечением, которое он подкрепил собственным сайтом и стартовым капиталом, который был равен 5000 долларов. После того, как Майкл Кобальд окончил университет, он решил всерьез заняться часовым бизнесом и стал нанимать своих первых работников. Первой моделью часов, созданной его компанией, были часы для полярников. Они были разработаны специально для ношения в экстремальных условиях. Изначально компания закупала швейцарские и немецкие детали, однако, уже сейчас, Kobold разрабатывает собственную производственную линию. Стоит отметить, что многие звезды шоу-бизнеса предпочитают часы Kobold. Кстати, практически все участники многочисленных экстремальных экспедиций, пользовались именно этими часами. Компания производит 9 основных коллекций, каждая из которых имеет свои отличительные особенности. Часы марки Kobold понравятся как рядовым любителям часов, которые выполнены в классическом стиле, так и людям, предпочитающим экстремальный спорт.&nbsp;</span></span></div>
 
